import { baseURL } from "./OpenAI";
import { useEffect, useState } from "react";
import axios from "axios";

function GetPetNames(specieInput)  {
    const urlBase = baseURL;
    const specie = specieInput;
    const [petNames, setPetNames] = useState([]);
    console.log(this.urlBase+"nlp-pet-name/specie/"+this.specie);
    useEffect(() => {
        axios
            .post(this.urlBase+"nlp-pet-name/specie/"+this.specie)
            .then(res => {
                this.petNames = res.data;
                this.specie = this.specie;
            })
            .catch(err => {
                console.log(err);
            });
    }, []);
}

export {GetPetNames}
